import React, { Component } from "react";

class Layout extends Component {
  render() {
    return (
      <div>
        <img
          src="https://i.vimeocdn.com/video/595198868_505x160.jpg"
          alt="test"
          className="images"
        />
        <h1>Vimeo App</h1>
      </div>
    );
  }
}

export default Layout;
